import React from 'react';
import Faq from './src/FAQ';



const title = {
  "heading":"FAQ"
}

const faqData = [

  {
    Question: 'how are you',
    Answer: 'answer',
  },
  {
    Question: 'hey this is FAQ',
    Answer: 'this is answer',
  },
  {
    Question: 'hey this is FAQ',
    Answer: 'this is answer',
  },
];



function App() {
  return (
    <div>
     <Faq
     faqData={faqData}
     title={title}/>
    </div>
  );
}

export default App;
